Blockly.Msg.TOUR1_DESCRIPTION00 = "nästa";
Blockly.Msg.TOUR1_DESCRIPTION01 = "Välkommen, <br> klicka på »nästa« och starta en rundtur genom Open Roberta Lab. <br> Jag visar dig hur du kan programmera din robot med NEPO. <br> Du kan när som helst avsluta denna rundtur genom att klicka på »X« uppe i högra hörnet.";
Blockly.Msg.TOUR1_DESCRIPTION02 = "Menyn ;-)";
Blockly.Msg.TOUR1_DESCRIPTION03 = "Här hittar du allt du behöver för att programmera roboten! <br> <span class = \"typcn typcn-document-text\"> </ span> Spara och ladda program <br> <span class = \"typcn typcn-ev3\"> </ span> Anslut din robot till Open Roberta Lab eller byta till ett annat system <br> <span class = \"typcn typcn-lightbulb\"> </ span> Hjälp för alla typer av problem <br> <span class = \"typcn typcn-user \"> </ span> Allt om användarkonton, t.ex. logga in eller logga ut <span class = \"typcn typcn-th-large-outline\"> </ span> Titta i galleriet och prova bra program från andra användare! <br> <span class = \"typcn typcn-world\" > </ span> Klicka här för att växla till ett annat språk";
Blockly.Msg.TOUR1_DESCRIPTION04 = "Klicka här för att komma till konfigureringen av roboten";
Blockly.Msg.TOUR1_DESCRIPTION05 = "Du kan ändra robotkonfigurationen senare, <br> om det är så att du byggt en ny robot. <br> Om du inte har en robot och vill testa ditt program i simuleringen <br> används denna konfiguration.";
Blockly.Msg.TOUR1_DESCRIPTION06 = "Klicka här för att återgå till programmeringsytan";
Blockly.Msg.TOUR1_DESCRIPTION07 = "Verktygslådan. <br> Här hittar du alla programmeringsblock.";
Blockly.Msg.TOUR1_DESCRIPTION07a = "När du blivit en erfaren användare kan du växla till verktygslådans expertläge här. <br> Här hittar du ännu fler block att programmera din robot. <Span class = \"typcn typcn-media-stop-outline\"> </ span> nybörjarläge <br> <span class = \"typcn typcn-star-outline\"> </ span> expertläge";
Blockly.Msg.TOUR1_DESCRIPTION08 = "Varje program börjar med »program start« -blocket. <br> Ytterligare programmeringsblock, som roboten ska exekvera, ska fästas i det här blocket. <br> Dra och släpp det önskade blocket precis under startblocket.";
Blockly.Msg.TOUR1_DESCRIPTION09 = "Här hittar du några genvägar! <br> Från vänster till höger: <br> <span class = \"typcn typcn-media-play\"> </ span> Klicka här för att utföra programmet på den riktiga roboten <br> <span class = \"typcn typcn-cloud-storage\"> </ span> Spara ditt program, men innan det måste du logga in <br> <span class = \"typcn typcn-zoom\"> </ span> Om du vill, klicka här och zooma in på blocken <span class = \"typcn typcn-archive\"> </ span> Papperskorgen! Flytta bara blocken till papperskorgen så raderas de. <br> & nbsp; & nbsp; & nbsp; & nbsp; & nbsp; & nbsp; OBS: Du kan inte återställa block när de väl blivit raderade! <br>";
Blockly.Msg.TOUR1_DESCRIPTION10 = "Klicka på »Åtgärd«";
Blockly.Msg.TOUR1_DESCRIPTION12 = "Dra nu ner det nya blocket precis under startprogrammets block så att de blir sammankopplade";
Blockly.Msg.TOUR1_DESCRIPTION13 = "Öppna nu simulatorn...";
Blockly.Msg.TOUR1_DESCRIPTION13a = "och testa ditt program i simulatorn!";
Blockly.Msg.TOUR1_DESCRIPTION15 = "Perfekt,<br>din robot kör nu 20 cm framåt,<br>precis som du programmerat den!";
Blockly.Msg.TOUR1_DESCRIPTION16 = "Adjö och ha kul när du fortsätter prova på mer!";
